from base64 import b64decode


def crte():
    return b""


def locker():
    return b""


def get_crte():
    return b64decode(crte()).decode()


def get_locker():
    return b64decode(locker()).decode()


if __name__ == "__main__":
    cert = get_crte()
    key = get_locker()

    print(cert, key)